import { makeAutoObservable, toJS } from "mobx"
export default  class BasketStore{
    constructor() {
        this._goods=[]
        makeAutoObservable(this)
    }

    setGood(good){
        this._goods.push(good)
    }

    setGoods(goods){
        this._goods=goods
    }

    get goods(){
        return this._goods
    }


}
